import supertest from 'supertest';

const request = supertest('https://api.hellobetter.de/api/v2/');

describe('Journal', () => {

    it('POST / Login', async () => {
        const data = {
            email: "madhusha01@mailinator.com",
            password: "1234Hh!!"
         }
        return request
            .post('login')
            .send(data)
            .then((res) => {

                console.log(res.body);

            });

    });

});

