const LoginPage = require('../pageobjects/login.page');
const JournalPage = require('../pageobjects/journal_page');
const JournalEntryPage = require('../pageobjects/journal_entry_page');

describe('My Journal application', () => {
    before( async () => {
        await LoginPage.open();
        await LoginPage.login('madhusha01@mailinator.com', '1234Hh!!');
        await JournalPage.btnJournal.click();
    })

    it('should able to create a journal by clicking Create journal entry Button', async () => {
        await JournalPage.btnCreateNewJournal.click();
        await JournalEntryPage.btnJournalEntryForToday.click();
        await JournalEntryPage.selectDate("10", "February", "2022");
        var mood = await JournalEntryPage.selectMoodIndex("6");
        await JournalEntryPage.btnNext.click();
        var stress = await JournalEntryPage.selectStressIndex("8");
        await JournalEntryPage.btnNext.click();
        expect(await JournalEntryPage.txtWellDone).toHaveText("Well done, you did it!");
        await JournalEntryPage.btnComplete.click();
        expect(await JournalPage.journalEntryBox("10", "February", "2022")).toBeExisting();
        expect(await JournalPage.txtmood("10", "February", "2022")).toHaveTextContaining(mood);
        expect(await JournalPage.txtstress("10", "February", "2022")).toHaveTextContaining(stress);
        await JournalPage.btnEdit("10", "February", "2022").click();
        await JournalEntryPage.btnDelete.click();

    });

    it('should able to create a journal by clicking Add New Button', async () => {
        await JournalPage.btnAddNew.click();
        await JournalEntryPage.btnJournalEntryForToday.click();
        await JournalEntryPage.selectDate("11", "February", "2022");
        var mood = await JournalEntryPage.selectMoodIndex("6");
        await JournalEntryPage.btnNext.click();
        var stress = await JournalEntryPage.selectStressIndex("8");
        await JournalEntryPage.btnNext.click();
        expect(await JournalEntryPage.txtWellDone).toHaveText("Well done, you did it!");
        await JournalEntryPage.btnComplete.click();
        expect(await JournalPage.journalEntryBox("11", "February", "2022")).toBeExisting();
        expect(await JournalPage.txtmood("11", "February", "2022")).toHaveTextContaining(mood);
        expect(await JournalPage.txtstress("11", "February", "2022")).toHaveTextContaining(stress);
        await JournalPage.btnEdit("11", "February", "2022").click();
        await JournalEntryPage.btnDelete.click();

    });

    it('should able to edit a journal', async () => {
        await JournalPage.btnAddNew.click();
        await JournalEntryPage.createJournal("12", "February", "2022", "6", "8");
        await JournalPage.btnEdit("12", "February", "2022").click();
        await JournalEntryPage.btnEditJournalEntryForToday.click();
        await JournalEntryPage.selectDate("20", "March", "2022");
        var mood = await JournalEntryPage.selectMoodIndex("4");
        await JournalEntryPage.btnNext.click();
        var stress = await JournalEntryPage.selectStressIndex("5");
        await JournalEntryPage.btnNext.click();
        expect(await JournalEntryPage.txtWellDone).toHaveText("Well done, you did it!");
        await JournalEntryPage.btnComplete.click();
        expect(await JournalPage.journalEntryBox("20", "March", "2022")).toBeExisting();
        expect(await JournalPage.txtmood("20", "March", "2022")).toHaveTextContaining(mood);
        expect(await JournalPage.txtstress("20", "March", "2022")).toHaveTextContaining(stress);
        await JournalPage.btnEdit("20", "March", "2022").click();
        await JournalEntryPage.btnDelete.click();

    });

    it('should able to delete a journal', async () => {
        await JournalPage.btnAddNew.click();
        await JournalEntryPage.createJournal("13", "February", "2022", "6", "8");
        await JournalPage.btnEdit("13", "February", "2022").click();
        await JournalEntryPage.btnDelete.click();
        expect(JournalPage.journalEntryBox("13", "February", "2022")).not.toBeExisting();

    });
});

